    var STANDARDFORM = {
        init: function () {
            STANDARDFORM.fancyLabels();
        },

        fancyLabels: function () {
            $('.checkout-page form, form.standard-form .form-item')
                .find('input, select, textarea')
                .not('input[type=checkbox]')
                .not('input[type=hidden]')
                .not('input[type=file]')
                .each(function () {
                    var $formInput = $(this);
                    if ($formInput.val()) {
                        $formInput.parents('.form-item').find('label').addClass('labelup no-anim');
                    }
                    $formInput.on('focus blur', function (e) {
                        if (e.type == 'focus') {
                            $formInput.parents('.form-item').find('label').removeClass('no-anim').addClass('labelup');
                        }
                        else if (!$formInput.val()) {
                            $formInput.parents('.form-item').find('label').removeClass('no-anim labelup');
                        }
                    });
                });

            $('form.webform-contact label').on('click', function (e) {
                var $label = $(this);
                var $target = $('#' + $label.attr('for'));
                if ($target.is('select')) {
                    e.preventDefault();
                }
            });
        },
    };


    $(function () {
        STANDARDFORM.init();
    });


    Drupal.behaviors.fancyLabels = {
        attach: function (context) {
            if (context instanceof $) {
                STANDARDFORM.fancyLabels();
            }
        }
    };


